import React from 'react'
import {useLocation} from 'react-router-dom'

function Product() {
    const location = useLocation();
    const {name, age} = location.state;

    return (
        <div>
            <h1>{name}</h1>        
            <h1>{age}</h1>
        </div>
    )
}

export default Product
